INSERT INTO `tab_information` VALUES ('108', 'Ivan Stojmenovic', '<strong>Prof. Ivan Stojmenovi</strong><span style=\"font-size: 12pt\">, IEEE Fellow, from School of Information Technology and Engineering, University of Ottawa, Ottawa, Canada. He got Ph.D degree in mathematics from the University of Zagreb, Croatia, 1985. His research interests include applied algorithms to Solve Scientific, Engineering and Practical Problems, including Distributed ad hoc, sensor, cellular wireless networks, Bioinspired, Parallel, Logic, Geometry, Chemistry, Combinatorics, Image. He has published over 120 papers in ACM Mobicom, IEEE Percom , IEEE MASS, IEEE SECON, IEEE INFOCOM, IEEE Sensors, IEEE Network, IEEE TPDS, IEEE TMC, IEEE TC, etc. and is the author of 4 books: Handbook of Applied Algorithms: Solving Scientific, Engineering and Practical Problems; Handbook of Sensor Networks: Algorithms and Architectures, Mobile Ad Hoc Networking; Handbook of Wireless Networks and Mobile Computing. He is the founder or editor-in-chief or editor of IEEE Transactions on Parallel and Distributed Systems, ACM/SPRINGER Wireless Networks, International Journal of Sensor Networks, Ad Hoc &amp; Sensor Wireless Networks: An International Journal, etc. He is the founder or program vice-chair or program co-chair of many conferences and workshops.Prof. Ivan Stojmenovi is the top 0.56% most cited authors in Computer Science (Citeseer August 2006:), and his honor includes Faculty of Engineering&rsquo;s 2004-2005 George S. Glinski Award for Excellence in Research, University of Ottawa, Royal Society Wolfson Research Merit Award, UK, June 2006, Best Paper Award of SENSORCOMM 2007, IFIP Int. Conference on Personal Wireless Communications, Fast Breaking Paper, October 2003(Thomson ISI Essential Science Indicators <a href=\"http://esi-topics.com/fbp/fbp-october2003.html\">http://esi-topics.com/fbp/fbp-october2003.html</a></span><span style=\"font-size: 12pt\">). </span><span style=\"font-size: 12pt\">He held r