INSERT INTO `tab_information` VALUES ('140', '', '<div id=\"BodyLabel\" style=\"padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\">\r\n<div><span style=\"color: #004a99; font-size: 10pt\"><font size=\"4\">221</font></span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\"><font size=\"4\">2008115 1400-1600</font></span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\"><font size=\"3\"><font color=\"#000000\">40~601</font></font></span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\"><font size=\"3\"><font color=\"#000000\"></font></font></span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\"><font size=\"4\"></font></span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\"><br />\r\n<a target=\"_blank\" href=\"../../upload/2008_09/08092511145404.doc\">Websense09-</a></span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\"></span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\">Websense (NASDAQ:WBSN), a global leader in integrated Web, email and data protection technologies, provides Essential Information Protection&trade; for more than 42 million employees at over 50,000 organisations worldwide. Distributed through its network of channel partners, Websense software and hosted security solutions work together to provide complete visibility and control over:</span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\">&bull; WHO is authorised to access Web sites, information, or applications;</span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\">&bull; WHAT information is sensitive and must be protected;</span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\">&bull; HOW information can be exchanged; and</span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\">&bull; WHERE information can be sent.</span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\">The new Websense&reg; Web Security Gateway solves growing challenges brought on by the explosion of Web 2.0 technologies.&nbsp; Backed by Websense&rsquo;s powerful ThreatSeeker&trade; Network the Websense Web Security Gateway analyses Web traffic in real-time &ndash; instantly categorising new sites and dynamic content, proactively discovering security risks and blocking dangerous malware.</span></div>\r\n<div style=\"margin-top: 6pt\"><span style=\"color: #004a99; font-size: 10pt\">With Websense you can leverage the enormous potential of Web 2.0 while keeping your networks, end-users and sensitive data secure.</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\">Websense</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">(</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">:WBSN</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\"> 1994 </span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">Web</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">2004-2006</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\"> &ldquo;25 </span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">&rdquo;</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">500</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">FTSE100</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">50000</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">4200</span><span style=\"color: #004a99; font-size: 10pt\"></span></div>\r\n<div><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">2007</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"color: #004a99; font-size: 10pt\">Websense</span><span style=\"color: #004a99; font-size: 10pt\"></span><span style=\"font-size: 10pt\"><a target=\"_blank\" href=\"http://www.websense.com/\"><span style=\"color: #004a99\">www.websense.com</span></a><span style=\"color: #004a99\">.</span></span></div>\r\n</div>', '2010-05-27 16:01:55', null, '1', '', 'N', null, null, null, null);
